import React from 'react';
import './resource.css';
import { useNavigate } from 'react-router-dom';

// 将 ResourceCard 组件改为函数组件
const ResourceCard = ({ title, source, id }) => {

    const navigate = useNavigate();

    const handleClick = () => {
        navigate(`/main/question/${id}`, {});
    };


    return (
        <div className="resource-card" onClick={handleClick}>
            <div className="resource-info">
                <span className="resource-title">{title}</span>
                <span className="resource-source">来源: {source}</span>
            </div>
        </div>
    );
};

export default ResourceCard;
